  {system_id: 13, name: "Caelax", diameter: 6349, mass: 5.525, orbital_distance: 0.6, description: "Like nearby Aventen, Caelax was named for an ancient philosopher and author. But where Aventen wrote for the military leaders of tomorrow, Caelax focused on those who feed, clothe, heal and arm the soldier. Her enormous tome, \"Service\" features a lengthy chapter on laws that formed the basis for the turian concept of citizenship tiers. Caelax is lower in temperature than Aventen, and its minerals were thus exploited first.", image: "data:image/jpeg;base64,", is_star: false, color: "red", orbital_period: 197},
  {system_id: 13, name: "Aventen", diameter: 5488, mass: 2.34, orbital_distance: 0.4, description: "Aventen is named for a tactician-philosopher whose treatise on leadership is known by every turian youth who pays attention in class. It is a small, hot rock planet surrounded by a haze of methane and helium. It was thoroughly mined for valuable minerals in the early days of the turian space age, and since then has had little to offer. ", image: "https://w0.peakpx.com/wallpaper/172/856/HD-wallpaper-a-blue-purple-galaxy-stars-nebula-space-galaxies-planets-thumbnail.jpg", is_star: false, color: "purple", orbital_period: 126},
