  {system_id: 13, name: "Trebia", diameter: 1265400, mass: 1748300.0, orbital_distance: 0.0, description: "Trebia, the central sun of the Trebian System, outputs three times the normal radiation levels of other stars its size. As such, life forms on the surrounding planets have been forced to adapt countermeasures to the suns blistering solar output.", image: "data:image/jpeg;base64,", is_star: true, color: "#F9F58D", orbital_period: 0},
  {system_id: 13, name: "Impera", diameter: 1676, mass: 0.5, orbital_distance: 2.4, description: "The small planet Impera is a hothouse of helium and argon, the latter a product of decaying radioactive materials. Robo-mining was once lucrative here, but like the rest of the solar system, the only remaining veins are inaccessible by cost-effective means.\n\nThe planet is named for Atrin Impera, the \"turian Machiavelli,\" whose ambitious political philosophies led to her reign as regent in the continent-spanning Nialin Empire for more than a decade.", image: "data:image/jpeg;base64,", is_star: false, color: "blue", orbital_period: 985},
  {system_id: 13, name: "Essenus", diameter: 73976, mass: 1253.0, orbital_distance: 3.4, description: "Essenus is a hydrogen-helium gas giant that was home to a substantial turian garrison defending the planet's fuel infrastructure. It once held a distribution center for antiproton-based fuel as well as the more common helium-3 collectors.", image: "data:image/jpeg;base64,", is_star: false, color: "#FCD24D", orbital_period: 2773},
