  {system_id: 12, name: "Venus", diameter: 12104, mass: 4.87, orbital_distance: 0.723, description: "Second planet in our local system, boasting the hottest temperatures of any planet.", image: "data:image/jpeg;base64,", is_star: false, color: "orange", orbital_period: 224},
