  {system_id: 12, name: "Uranus", diameter: 51118, mass: 86.8, orbital_distance: 4.0, description: "Seventh planet in our local system. Uranus is an ice world with a small, vertical ring.", image: "https://wallpaperaccess.com/full/415159.jpg", is_star: false, color: "#95FCF1", orbital_period: 30589},
  {system_id: 13, name: "Datriux", diameter: 14533, mass: 442.0, orbital_distance: 4.3, description: "Datriux is a small rock and ice planet with an extremely thin nitrogen-based atmosphere. Exploited for its metal deposits, the planet's iridium was marked as part of Palaven's strategic reserve during the Krogan Rebellions. Its facilities have been maintained to this day.", image: "data:image/jpeg;base64,", is_star: false, color: "#B6D3DF", orbital_period: 3782},
  {system_id: 13, name: "Palavan", diameter: 12450, mass: 7.6, orbital_distance: 1.15, description: "\"The only thing on this planet that isn't silver are the turians. It's all too clear they're made of steel.\" These were Alliance hero Jon Grissom's impressions of the turian homeworld Palaven, seen by humans for the first time following the First Contact War. The turians' martial attitude permeates every aspect of Palaven society, from architecture to art to politics.", image: "data:image/jpeg;base64,", is_star: false, color: "green", orbital_period: 412},
